style.css:
@-moz-document domain("wikipedia.org") {
* {
    color: #aaa;
    background: #333;
    background-color: #333 !important;
}

a {
    color: #bfff00;
}
a:hover {
    color: #f0ffc4;
}
a:visited {
    color: #00ffb7;
}
a:focus {
    color: #f90;
}
/* ----------------------------------------- */
#mw-panel a {
    color: #bfff00;
}

#mw-panel a:hover {
    color: #f0ffc4;
}

#mw-panel a:visited {
    color: #00ffb7;
}

#mw-panel a:focus {
    color: #f90;
}
/* ----------------------------------------- */
#mw-head a {
    color: #bfff00;
}

#mw-head a:hover {
    color: #f0ffc4;
}

#mw-head a:visited {
    color: #00ffb7;
}

#mw-head a:focus {
    color: #f90;
}
/* ----------------------------------------- */
.mw-parser-output a.external {
    color: #468eff;
}
.mw-parser-output a.external:hover {
    color: #cbff46;
}
.mw-parser-output a.extiw:visited,
.mw-parser-output a.external:visited {
    color: #00ffb7;
}
.mw-parser-output a.external:focus {
    color: #f90;
}

.tocnumber {
    color: #f5aeff;
}

.mw-footer li {
    color: #aaa;
}
}
